import React, { useEffect, useState } from "react";
import getDataFromApi from "../services/api";

const App = () => {
  const [cartoons, setCartoons] = useState([]);

  useEffect(() => {
    getDataFromApi().then((cartoon) => {
      setCartoons(cartoon);
    });
  }, []);
  console.log(cartoons);
  return (
    <div>
      <img />
      <h1>Nombre: </h1>
      <h2>Especie: </h2>
    </div>
  );
};

export default App;
